import Cocoa

let inputStr = ""

var inputArray = Array(inputStr)
let capitalLetters = "ABCDEFGHIKLMNOPQRSTVXYZ"
var noChangesInEntireString: Bool = false

print("Start: " + String(inputArray.count))

// Starting the entire string loop
while !noChangesInEntireString {
    
    // Initializing
    noChangesInEntireString = true
    var i = 0
    
    // Starting the string iteration loop
    while i < inputArray.count {
        
        // Initalizing
        let checkCharacter = String(inputArray[i])
        var checkCharacterCaseToggled: Character
        var reductionFound = false
        
        // Finding the case toggled character
        if capitalLetters.contains(checkCharacter){
            checkCharacterCaseToggled = Character(checkCharacter.lowercased())
        } else {
            checkCharacterCaseToggled = Character(checkCharacter.uppercased())
        }
        
        // Check Character to the left first
        if i > 0 && inputArray[i - 1] == checkCharacterCaseToggled {
            
            // Removing the characters
            inputArray.remove(at: i)
            inputArray.remove(at: (i - 1))
            
            // Setting the boolean values
            reductionFound = true
            
            // Offsetting the increment as to not skip characters
            i -= 1
        }
            
        // Then check Character to the right
        else if i < (inputArray.count - 1) && inputArray[i + 1] == checkCharacterCaseToggled {
            
            // Removing the characters
            inputArray.remove(at: (i + 1))
            inputArray.remove(at: i)
            
            // Setting the boolean values
            reductionFound = true
        }
        
        // Setting the string loop to have to loop again
        if reductionFound {
            noChangesInEntireString = false
        } else {
            // Checking the next character
            i += 1
        }
    }
}

print("Result: " + String(inputArray.count))
print(String(inputArray))
